import React from "react";
import leftButton from "../images/left_button.svg";
import "../Card/Card.css"; // Ensure the styles are correctly imported

const LeftBtn = ({ onClick }) => {
  return (
    <button className="rocket-card__button left" onClick={onClick}>
      <img src={leftButton} alt="Previous" />
    </button>
  );
};

export default LeftBtn;
